import ListUserItem from "../listUserItem";

export const renderUserList = (user, userDisplay) => {
  let container = []
  let i = 0
  while (i < 100) {
    if (!user[i]) break
    container.push(user[i])
    i++;
  }
  if (userDisplay) {
    return container.map((item, i) => (
      <ListUserItem
        key={`ID${i}U`}
        id={item[0].data}
        name={item[1].data}
        primary={item[2].data}
        department={item[3].data}
        device={item[4].data}
        location={item[5].data}
      />
    ));
  }
};
